column8:
人気商品POST BOXにミニサイズが登場！！<br>
<br>
U.S. MINI POST BOXは大好評の U.S. POST BOXのハーフサイズとなっております。<br>
コンパクトなU.S. MINI POST BOXは、手紙はもちろんCDやお菓子などの収納やデスク廻りの整理にも最適です。<br>
ポストボックスはアメリカの郵便局で実際に仕分けに使われているボックスで、<br>
ポリプロピレン素材にスチールワイヤーを通すことで、軽量でありながらとても頑丈な造りとなっております。<br>
 <br>
サイズ H180xW280xD220cm<br>
規格 <br>
素材：ポリプロぺリン<br>
注意事項 <br>
実物とパソコンモニター画面上で見た写真画像との色が、実際と多少異なる場合もございますのでご了承下さい。<br><style type="text/css">
